import Home from '../home';
import Menu from '../../components/menu';
import AboutMe from '../aboutMe';
import Experience from '../experience';
import Contact from '../contact';

function MainPage(){
    return(
        <>
            <Menu/>
            <Home/>
            <AboutMe/>
            <Experience/>
            <Contact/>
        </>
    );
}

export default MainPage;
